import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Header />
     </div>
  );
}

const Header = () => {
  return (
    <div className="Header">
      <ul>
        <li>home</li>
        <li>project</li>
        <li>content</li>
      </ul>
     </div>
  );
}



export default App;
